import { SET_PRODUCTS } from "./products.types";

const INITIAL_STATE = {
    products: [],
};

const reducerProducts = (state = INITIAL_STATE, action, payload) => {
    switch(action.type) {
        case SET_PRODUCTS:
            console.log(payload)
            return {
                ...state, products: state.products = payload
            }
        default: return state;
    }
};

export default reducerProducts;
